import React, { Component } from 'react'
import { Progress } from 'antd';
export default class Progresss extends Component {
    render() {
        return (
            <div>
                <Popconfirm
                    title="Are you sure to delete this task?"
                    onConfirm={confirm}
                    onCancel={cancel}
                    okText="Yes"
                    cancelText="No"
                >
                    <a href="#">Delete</a>
                </Popconfirm>,
            </div>
        )
    }
}
